# Function converts dotted quad to an integer for ip2country lookup
function IptoInt(){ 
echo $1|awk -F'\.' '{print ($1 * 2^24)+($2 * 2^16)+($3 * 2^8)+$4}' 2>/dev/null
} 
## Function IP2Country lookup for a single IP
function IPtoCountry(){
DEC_IP=$(echo $IPGET|awk -F'\.' '{print ($1 * 2^24)+($2 * 2^16)+($3 * 2^8)+$4}' 2>/dev/null) 
HOSTNME=$(dig +short -x $IPGET | awk '{print $NF }' | tr -d '\n')
[ "$HOSTNME" == "" ] || [ "$HOSTNME" == "reached" ] && HOSTNME="Not-Found"
COUNTRY=$(awk -v decip="$DEC_IP" -v IP="$INPUT" -v HN="$HOSTNME" -F'\t' '{ if ($1 <=decip &&  $2>=decip ) printf "%-18s%-3s%-25s%-15s\n", IP,$3,$4,HN }' /tmp/GeoDecIP2Country.txt)
[ "$COUNTRY" == "" ] && echo "$INPUT  not valid, try again....  " && exit
echo  -e "IP\t\tCOUNTRY\t\t\t\tDNS"
awk -v decip="$DEC_IP" -v IP="$IPGET" -v HN="$HOSTNME" -F'\t' '{ if ($1 <=decip &&  $2>=decip ) printf "%-18s%-3s%-25s%-15s\n", IP,$3,$4,HN }' /tmp/GeoDecIP2Country.txt
echo ""
echo ""
exit
}
## Function to grab IP info from a single file or multiple files in a directory
function IPListtoCountry(){
[ "$2" == "-c" ] &&  CONSOLE="Yes"
[ -d $INPUT ] && echo "Output HTML File Name" && read OUTPUT &&  echo "" > /tmp/$OUTPUT.txt && echo "" > /tmp/$OUTPUT.html && echo "" > $OUTPUT.csv
